        <Container>
          <Row className="px-4 my-5"> 
            <Col sm={7}><PostTable/> </Col>
            <Col sm={5}><h1 className="font-weight-light"> What is Onion? </h1>
            <p className="mt-4"> A community where you can buy or sell secondhand items </p>
              </Col>
          </Row>

        </Container>
    );
};

